Meteor.startup(function() {

  console.log('Running server startup code...');

  Channels.remove({});

  Channels.insert({
    name: "general"
  });
  Channels.insert({
    name: "random"
  });

  Session.set('channel', 'general');

  Factory.define('message', Messages, {
    text: function() {
    	return Fake.sentence();
    },
    user: Meteor.users.findOne()._id,
    timestamp: Date.now()
  });

  Factory.define('message', Messages, {
    text: function() {
      return Fake.sentence();
    },
    user: Meteor.users.findOne()._id,
    timestamp: Date.now(),
    channel: 'general'
  });

});
